function CommonLogin() {    
    return (
      <> 
        <div id="modal">
            <h4>Сіз кімсіз?</h4>
            <div id="images">
             <div id="image1">
              <img alt="ss" src={"https://static.vecteezy.com/system/resources/previews/005/519/978/original/cartoon-drawing-of-a-teacher-vector.jpg"} width="200px" height="200px" />
             </div>

             <div id="image2">
              <img alt="ss" src={"https://i.pinimg.com/736x/18/65/49/186549476b8aa1426ab2e627ce512ecb.jpg"} width="200px" height="200px" />
             </div> 

            </div>
        </div>  
  
      </>
    );
  }
  
  export default CommonLogin;
